--- 
inherit: 
    - UICollectionReusableView
    - UIView
    - UIResponder
    - NSObject
conform: 
    - NSCoding (UIView)
    - UIAppearance (UIView)
    - UIAppearanceContainer (UIView)
    - NSObject (NSObject)
properties: !java.util.LinkedHashMap
    backgroundView: !java.util.LinkedHashMap
        name: backgroundView
        type: UIView
        ref: "*"
        explanation: The view that is displayed behind the cell?s other content.
        readonly: false
    contentView: !java.util.LinkedHashMap
        name: contentView
        type: UIView
        ref: "*"
        explanation: The main view to which you add your cell?s custom content. (read-only)
        readonly: true
    highlighted: !java.util.LinkedHashMap
        name: highlighted
        type: BOOL
        ref: ""
        explanation: The highlight state of the cell.
        readonly: false
    selected: !java.util.LinkedHashMap
        name: selected
        type: BOOL
        ref: ""
        explanation: The selection state of the cell.
        readonly: false
    selectedBackgroundView: !java.util.LinkedHashMap
        name: selectedBackgroundView
        type: UIView
        ref: "*"
        explanation: "The view that is displayed just above the background view when the cell is selected. "
        readonly: false
methods: !java.util.LinkedHashMap {}
